import React from 'react';
import './App.css';
import Main from './Pages/MainPage';
import { BrowserRouter, Switch, Route } from 'react-router-dom';
import Beeline from './Pages/BeelinePage';
import Header from './components/ArtDesign/Header';
import Footer from './components/ArtDesign/Footer';
import Mtc from './Pages/MtcPage';
import Megafon from './Pages/MegaphonePage';
import { Example } from './components/Animation/animationCard';
import { motion } from 'framer-motion';

function App() {
  return (
    <BrowserRouter>
      <div className="appWrapper">
        <header className="header">
          <Header />
          <Example />
        </header>
        <div className="content">
          <Switch>
            <Route exact path="/" component={Main} />
            <Route exact path="/Form/1" component={Mtc} />
            <Route exact path="/Form/2" component={Beeline} />
            <Route exact path="/Form/3" component={Megafon} />
          </Switch>
        </div>
        <motion.div
          className="title"
          initial={{ y: -800 }}
          animate={{ y: -800 }}
          transition={{ delay: 0.2, type: 'spring' }}>
          <footer className="footer">
            <Footer />
          </footer>
        </motion.div>
      </div>
    </BrowserRouter>
  );
}

export default App;
